import React from 'react';

const SimpleComponent = ({ onLogin, onLogOut, isAuth }) => {
  return (
    <>
      <button onClick={!isAuth ? onLogin : onLogOut}>{!isAuth ? 'Login' : 'Logout'}</button>
    </>
  );
}

export default SimpleComponent;
